частника - построить свой уникальный проект, город или парк мечты, но ничего строить вручную не надо. Для этого ребята изучат правила построения 3D-объектов, используя редактор Tinkercad, познакомятся с основами дизайна и правилами цветовой палитры, чтобы создать свои игровые текстуры.','',NULL,NULL,NULL),(52,'Дне Открытых Дверей','','',NULL,NULL,NULL),(53,'Дне Открытых Дверей','','',NULL,NULL,NULL),(55,'Unity. Создание игр. Уровень 1. Основа','Unity — взрослый инструмент для разработки игр и приложений, с помощью которого ребенок создаст собственную игру. Для этого он изучит основы языка программирования С#, узнает, как и зачем реализована физическая модель и освоит компонентную систему движка. Результатом станет готовая игра для Windows и Mac OC.','',8,12000,NULL),(56,'Создание игр на Scratch. Уровень 1.','Курс рассчитан на ребят 7-10 лет, не имеющих предварительного опыта в программировании. Задачи курса познакомить детей с основами работы в Scratch - структурой языка, основными алгоритмическими конструкциями и приемами решения тривиальных задач. Развить у учеников алгоритмическое мышление и навыки составления собственных алгоритмов. Познакомить с основами проектирования программ. В конце курса реализовать собственный игровой проект на языке Scratch, продуманный каждым учеником самостоятельно.','',8,12000,NULL);
