  `cost` decimal(10,0) unsigned DEFAULT NULL,
  `group_id` int(10) unsigned DEFAULT NULL,
  `lecture_hall_id` smallint(5) unsigned DEFAULT NULL,
  `course_id` smallint(5) unsigned DEFAULT NULL,
  `teacher_id` smallint(5) unsigned DEFAULT NULL,
  `date_start` date DEFAULT NULL,
  `time_start` time DEFAULT NULL,
  `lead_link` text,
  `calendar_event_id` text,
  `duration` int(11) DEFAULT NULL,
  `city_id` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`lesson_id`),
  KEY `city_ind` (`city_id`),
  CONSTRAINT `lesson_ibfk_1` FOREIGN KEY (`city_id`) REFERENCES `city` (`city_id`)
) ENGINE=InnoDB AUTO_INCREMENT=505 DEFAULT CHARSET=utf8 COMMENT='lessons';
